package com.SC11ExpressionLanguage;

public class PQR {
	
	private int x;
	private int y;
	
	public PQR() {
		super();
		// TODO Auto-generated constructor stub
	}

	public PQR(int x, int y) {
		super();
		this.x = x;
		this.y = y;
	}

	@Override
	public String toString() {
		return "PQR [x=" + x + ", y=" + y + "]";
	}

}
